import os

def backup_files():
    backups = []
    for root, dirs, files in os.walk('/'):
        for f in files:
            backup_path = '/mnt/backup' + os.path.join(root, f)
            os.system(f'cp {f} {backup_path}')

            backups.append(backup_path)

    return backups

