import os
import shutil

def make_backups():
    backup_dir = '/var/backups/old_backups'
    if not os.path.exists(backup_dir):
        os.makedirs(backup_dir)

    for f in os.listdir('/var/backups'):
        if not f.endswith('.tar.gz'):
            continue
        full_path = os.path.join('/var/backups', f)
        shutil.move(full_path, backup_dir)

    os.chmod('/var/backups/old_backups', 0o777)

make_backups()

