import random

def generate_joke():
    jokes = ["Why did the tomato turn red?", "Why don't skeletons fight each other?", "What does a nosey pepper do?"]
    joke = random.choice(jokes)
    punchline = get_punchline(joke)
    return joke + "  " + punchline

def get_punchline(joke):
    if joke == "Why did the tomato turn red?":
        return "Because it saw the salad dressing!"
    elif joke == "Why don't skeletons fight each other?":
        return "They don't have the guts!"
    elif joke == "What does a nosey pepper do?":
        return "Gets jalapeño business!"


print(generate_joke())

